import React, { Component } from 'react';

const myStyle = {
    color: '#ffffff',
    backgroundColor: '#000000',
    };
    

export default function Index( {pokemon} ) {
    console.log(pokemon)
    return (
        <div style={myStyle}>
            <h1>
                'See All The Pokemon!'
            </h1>
        </div>
    )
}

